import React, { useCallback, useEffect, useState, useMemo } from 'react';
import { 
    Box,
    Flex,
    Img,
 } from '@chakra-ui/react';
import phoneUI from './assets/phoneUI.svg';



function Header() {
    return (
        <>
        <Box as="section" className='header' mt="170">
            <Flex>
                <Box width="700px" >
                    <Img src={phoneUI} />
                </Box>
            </Flex>
        </Box>
    </>
    )
}

export default Header;
